- uid: SuperOffice.Threading.AsyncQueueHandler`2.AsynchronousOperation
  commentId: M:SuperOffice.Threading.AsyncQueueHandler`2.AsynchronousOperation
  id: AsynchronousOperation
  parent: SuperOffice.Threading.AsyncQueueHandler`2
  langs:
  - csharp
  - vb
  name: AsynchronousOperation()
  nameWithType: AsyncQueueHandler<TAsynchronousHandlerProcessor, TAsynchronousArgument>.AsynchronousOperation()
  fullName: SuperOffice.Threading.AsyncQueueHandler<TAsynchronousHandlerProcessor, TAsynchronousArgument>.AsynchronousOperation()
  type: Method
  assemblies:
  - SoCore
  namespace: SuperOffice.Threading
  summary: >-
    Public interface for the asynchronous part of the operation. Any data needed

    for its execution has to be copied by the <xref href="SuperOffice.Threading.AsyncQueueHandler%602.SynchronousSetup(%601)" data-throw-if-not-resolved="false"></xref>, because

    you DO NOT KNOW when the OnOperation method will actually be called.
  remarks: >-
    You should not really call this method if the <xref href="SuperOffice.Threading.AsyncQueueHandler%602.SynchronousSetup(%601)" data-throw-if-not-resolved="false"></xref> returned false, which can be checked

    by accessing the WorkToDo property. However, it is not an error to call

    this method anyway, as it will check the workToDo variable before actually doing anything.

    <p></p>

    However, if you forget to call <xref href="SuperOffice.Threading.AsyncQueueHandler%602.SynchronousSetup(%601)" data-throw-if-not-resolved="false"></xref>, you will get an exception here.
  example:
  - >-
    <pre><code class="lang-csharp">AsynchronousHandler someOperation = new SomeOperation();

    someOperation.SynchronousSetup( currentQuery );

    ...

    if( someOperation.WorkToDo )
        someOperation.AsynchronousOperation();
    // we're done, async thread will sooner or later do the work</code></pre>
  syntax:
    content: public void AsynchronousOperation()
    content.vb: Public Sub AsynchronousOperation()
  overload: SuperOffice.Threading.AsyncQueueHandler`2.AsynchronousOperation*
  nameWithType.vb: AsyncQueueHandler(Of TAsynchronousHandlerProcessor, TAsynchronousArgument).AsynchronousOperation()
  fullName.vb: SuperOffice.Threading.AsyncQueueHandler(Of TAsynchronousHandlerProcessor, TAsynchronousArgument).AsynchronousOperation()
